import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import './Signup.css';
const Signup=()=>{
    const navigate=new useNavigate();
    const [name,setName]=useState("");
    const [password,setPassword]=useState("");
    const [formData,setformData]=useState(
        {
            name:"",
            password:""
        }
    )
    const handleChange=(e)=>{
        const {name,value}=e.target;
        setformData({
            ...formData,
            [name]:value
        })
    }
    const nameChangeHandler=(e)=>{
        setName(e.target.value);
    }
    const passwordChangeHandler=(e)=>{
        setPassword(e.target.value);
    }
    const submitHandler=()=>{
       // alert(password);
       navigate("/home")
        console.log(""+name+" "+password);
    }
    return(
    <div>           
        <div className="container">  
            <h1 className="top-items">Sign Up</h1>
            <h2 className="top-items">Authenticator</h2>
            <form onSubmit={submitHandler}>
                <input placeholder="Enter Email" type="email" id="email"/>
                <input name="name" placeholder="your Name" onChange={nameChangeHandler} value={name} type="text" id="name"/>
                <input name="password"  placeholder="Password" onChange={passwordChangeHandler} value={password} type="password" id="passkey"/>
                <select id="gender" name="Gender">
                    <option value="Gender">Gender</option>
                    <option value="Male">Male</option>
                    <option value="Female">Female</option>
                </select>
                <input type="radio" id="option1" name="choices" value="1"/>
                <input type="radio" id="option1" name="choices" value="2"/>
                <input type="radio" id="option1" name="choices" value="3"/>
               
                <button type="submit">Submit</button>
           </form>
        </div>
    
    </div>)
}

export default Signup
